 # Program to find and display the first 100 prime numbers

# Define a function to check if a number is prime
def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

# Find the first 100 prime numbers
primes = [2]
i = 3
while len(primes) < 100:
    if is_prime(i):
        primes.append(i)
    i += 1

# Display the first 100 prime numbers
print("The first 100 prime numbers are:")
for p in primes:
    print(p, end=' ')

